- input: "TEXT\x1CC00135368\x1C.TEXT\x1C\x1CF3XA\x1CThe 12 day Pre-General report
    is being amended to reflect the financial changes as the result of amendments
    made to the July 20 Monthly, August 20 Monthly, September 20 Monthly, and October
    20 Monthly reports. As of January 31, 2013, the following additional changes have
    been made: A direct contribution of $500 made to the Committee to Re-Elect Linda
    Sanchez that was not imported correctly at the time of the intiail filing has
    been added to the amended report. Offset reported in line 21b related to expenses
    in line 24 was updated to match. Two additional staff member's 'salaries & benefits'
    are added to the Pre-General amendment to reflect updated information. Subsequent
    changes to the line 24 offsets are reflected on line 21(b). The amended report
    also contains a new line 28 refund made to Mrs. Walter F. Brissenden to correspond
    with the contribution refund request listed on 8/30/2012.\n"
